MongoDB: $in in aggregation is slow despite the index<p>I have a collection of users (~8k documents) and a collection of jobs (~150k documents). I need to create an aggregation with a stage that finds jobs each user was accepted to (accepted in job model is an array of ObjectIds):</p>
<pre><code>db.getCollection('users')
    .aggregate([
        {
            $lookup: {
                from: 'jobs',
                as: 'jobs',
                let: { accepted: '$_id' },
                pipeline: [
                    {
                        $match: {
                            $expr: {
                                $and: [
                                    { $gte: ['$timestamp', 1643223600] },
                                    { $in: ['$$accepted', '$accepted'] }
                                ]
                            }
                        },
                    },
                ]
            }
        },
    ])
</code></pre>
<p>This aggregation is extremely slow. Even limiting the number of output records to 10 takes ~1 minute to accomplish. Although, the number of jobs with timestamp greater than 1643223600 is not so big - it's around 3000 documents. I added the following indexes:</p>
<pre><code>{timestamp: -1},
{accepted: 1}
</code></pre>
<p>but it does not help. However, if I create a copy of the database and remove all the shifts which don't satisfy the timestamp condition, the aggregation works much faster (several seconds). Does it mean that the index doesn't work for some reason? If a run a simple query on jobs collection with explain with a condition on accepted field, it shows that IXSCAN was performed</p>
<p>UPD: since $in doesn't work with compound indexes, workaround for Mongodb4.4 is:</p>
<pre><code> {
            $lookup: {
                from: 'jobs',
                as: 'jobs',
                localField: '_id',
                foreignField: 'accepted'
            }
        },
        { $match: { $expr: { $ne: [{ $size: '$jobs' }, 0] } } },
        { $unwind: '$jobs' },
        {
            $match: { 'jobs.timestamp': { $gte: 1643223600 } }
        },
</code></pre>

