Postman Get request works but not in browser- react/mongoose/express<p>I know there are a lot of other &quot;works in postman and not in browser&quot; posts, but I've read through them and cannot find anything to give direction on what I'm not catching here. Most of those had to do with proxy issues, but I dont have any proxy's set up.</p>
<p>I recently changed from using a pymongo backend to mongoose/express. My find() works for the get all clients just fine on the browser side, but the findOne() get comes back undefined (I was getting an unexpected token JSON error but that is resolved although I dont know what actually fixed it), yet in Postman it brings exactly what I'm looking for. I'm assuming its something simple, but I can't seem to spot it.</p>
<p>Backend-
index.js</p>
<pre><code>const express = require(&quot;express&quot;)
const mongoose = require(&quot;mongoose&quot;)
const cors = require('cors')
const clientRoutes = require(&quot;./routes/clientRoutes&quot;)
const contractRoutes = require(&quot;./routes/contractRoutes&quot;)
const bodyParser = require('body-parser');

mongoose
    .connect(&quot;MONGODB URL&quot;, { useNewUrlParser: true })
    .then(() =&gt; {
        const app = express()
        app.use(express.json())
        app.use(cors())
        app.use(bodyParser.json());
        app.use(&quot;/api&quot;, clientRoutes)
        app.use(&quot;/api&quot;, contractRoutes)

        app.listen(5000, () =&gt; {
        console.log(&quot;Server has started&quot;)   
        })

})
</code></pre>
<p>Schema</p>
<pre><code>const mongoose = require(&quot;mongoose&quot;)

const schema = mongoose.Schema({
    clientId: Number,
    firstName: String,
    lastName: String,
    phone: String,
    contracts: [{
        contractId: Number,
        authNumber: String,
        contType: String,
        contHours: Number,
        contStartDate: Date,
        contEndDate: Date
    }],

})

module.exports = mongoose.model(&quot;Client&quot;, schema)
</code></pre>
<p>routes-</p>
<pre><code>const express = require(&quot;express&quot;)
const Client = require(&quot;../models/Client.js&quot;)
const router = express.Router()


//Client routes
router.get(&quot;/clients&quot;, async (req, res) =&gt; {
    const clients = await Client.find()
    res.send(clients)
})

router.get(&quot;/clients/:clientId&quot;, async (req, res) =&gt; {
   try {
    const client = await Client.findOne({ clientId: req.params.clientId })
    res.send(client)
   } catch {
       res.status(404)
       res.send({ error: &quot;Client not found&quot;})
   }
})
</code></pre>
<p>React frontend component making the request-</p>
